import { AppBar, Toolbar, Typography } from "@material-ui/core";
import SearchIcon from '@material-ui/icons/Search';

function App() {
  return (
    <div className="App">
      <AppBar position='static'>
        <Toolbar style={{ backgroundColor: '#4f053b' }}>
          <Typography variant="h4">Vocab</Typography>
        </Toolbar>
      </AppBar>
    </div>
  );
}

export default App;
